import { useEffect } from "react"
import axios from 'axios';

import React from 'react'

const Context = () => {
    
    const url = 'https://jsonplaceholder.typicode.com/users'

    useEffect(() => {
      axios(url)
      .then(res => console.log(res.data))
    }, [])

  return (
    <div>Context</div>
  )
}

export default Context
